    <script>
        window.addEventListener("scroll", function() {
          const wSquare = document.getElementById('whiteSquare');
          const rect = wSquare.getBoundingClientRect();

          if (rect.top >= 0 && rect.bottom <= (window.innerHeight || document.documentElement.clientHeight)) {
              // Element is in view, trigger the animation
              wSquare.style.transform = 'scaleX(1)';
              wSquare.style.transformOrigin = 'center';
              wSquare.style.transformBox = 'fill-box';
              wSquare.style.opacity = '0.75'
          } else {
              // Element is out of view, reset the animation
              wSquare.style.transform = 'scaleX(0)';
              wSquare.style.transformOrigin = 'center';
              wSquare.style.transformBox = 'fill-box';           
              wSquare.style.opacity = '0'
          }
      });

      const imageSlides = document.querySelectorAll('.image-slide');

        imageSlides.forEach((imageSlide) => {
            imageSlide.addEventListener('mouseover', () => {
                // Pause the animation of the hovered image
                imageSlide.style.animationPlayState = 'paused';

                // Enlarge the hovered image
                imageSlide.style.transform = 'scale(1.2)';
            });

            imageSlide.addEventListener('mouseout', () => {
                // Resume the animation of the hovered image
                imageSlide.style.animationPlayState = 'running';

                // Shrink the image back to its original size
                imageSlide.style.transform = 'scale(1)';
            });
        });
    </script>
